from collections import deque

def can_stack_cubes(blocks):
    blocks = deque(blocks)
    last = max(blocks)
    n = len(blocks)
    while n >= 0:
        if blocks[0] > blocks[n - 1]:
            if blocks[0] > last:
                return 'No'
            last = blocks[0]
            blocks.popleft()
        else:
            if blocks[n - 1] > last:
                return 'No'
            last = blocks[n - 1]
            blocks.pop()
        n -= 1
    return 'Yes'

